import React from "react";


const Home = () => {
    return (
        <div className="row">
        <div className="col-md-10">
        <div className="row">
        <div className="col-md-6">
            <h1 className="text-center">hello</h1>
        </div>
        <div className="col-md-6">
            <h1 className="text-center">world</h1>

        </div>

        </div>

        </div>

        </div>
    );
}

export default Home;
